INSERT INTO `ren_bo` VALUES ('BO_c9ce9803-87f1-4605-95e5-0c94c5c4e6b2', 'Request', 'Process_4bd51644-ce34-4d04-889c-d532b7f6a469', '0', '<businessclass\r\n        version=\"1.0\"\r\n        xmlns=\"http://www.w3.org/2005/07/scxml\"\r\n        name=\"Request\"\r\n        initial=\"Initial\">\r\n\r\n    <datamodel>\r\n        <!---->\r\n        <data id=\"taskName\" expr=\"\"/>\r\n        <data id=\"taskDescription\" expr=\"\"/>\r\n        <data id=\"judgeCount\" expr=\"3\"/>\r\n        <data id=\"decomposeCount\" expr=\"3\"/>\r\n        <data id=\"decomposeVoteCount\" expr=\"3\"/>\r\n        <data id=\"solveCount\" expr=\"3\"/>\r\n        <data id=\"solveVoteCount\" expr=\"3\"/>\r\n    </datamodel>\r\n\r\n    <!--  -->\r\n\r\n    <!-- publisher -->\r\n    <state id=\"Initial\">\r\n        <onentry>\r\n            <log label=\"Request_init\" expr=\"\'entry Initial state\'\"/>\r\n        </onentry>\r\n        <!-- publisherpublish -->\r\n        <transition event=\"submit\" target=\"Waiting\">\r\n            <!--1.paramlocationdatamodeldatalocationlocationdatavalue\r\n                2.namelistnamelistdatamodeldataIDID\r\n                3.paramnamelist\r\n                -->\r\n            <assign location=\"taskName\" expr=\"_event.data.get(\'taskName\')\"/>\r\n            <assign location=\"taskDescription\" expr=\"_event.data.get(\'taskDescription\')\"/>\r\n            <assign location=\"judgeCount\" expr=\"_event.data.get(\'judgeCount\')\"/>\r\n            <assign location=\"decomposeCount\" expr=\"_event.data.get(\'decomposeCount\')\"/>\r\n            <assign location=\"decomposeVoteCount\" expr=\"_event.data.get(\'decomposeVoteCount\')\"/>\r\n            <assign location=\"solveCount\" expr=\"_event.data.get(\'solveCount\')\"/>\r\n            <assign location=\"solveVoteCount\" expr=\"_event.data.get(\'solveVoteCount\')\"/>\r\n\r\n            <newbo src=\"Crowdsourcing.xml\" instancesExpr=\"1\">\r\n                <param name=\"taskName\" expr=\"taskName\"/>\r\n                <param name=\"taskDescription\" expr=\"taskDescription\"/>\r\n                <param name=\"judgeCount\" expr=\"judgeCount\"/>\r\n                <param name=\"decomposeCount\" expr=\"decomposeCount\"/>\r\n                <param name=\"decomposeVoteCount\" expr=\" decomposeVoteCount\"/>\r\n                <param name=\"solveCount\" expr=\"solveCount\"/>\r\n                <param name=\"solveVoteCount\" expr=\"solveVoteCount\"/>\r\n            </newbo>\r\n        </transition>\r\n        <transition event=\"cancel\" target=\"Final\"/>\r\n        <onexit>\r\n            <log label=\"Request_init\" expr=\"\'exit Initial state\'\"/>\r\n        </onexit>\r\n    </state>\r\n\r\n    <state id=\"Waiting\">\r\n        <onentry>\r\n            <log label=\"Request_waiting\" expr=\"\'entry Waiting state\'\"/>\r\n        </onentry>\r\n        <transition event=\"Crowdsourcing.finish\" target=\"Final\"/>\r\n        <onexit>\r\n            <log label=\"Request_waiting\" expr=\"\'exit Waiting state\'\"/>\r\n        </onexit>\r\n    </state>\r\n\r\n    <final id=\"Final\">\r\n        <onentry>\r\n            <log label=\"Request_final\" expr=\"\'entry Final state\'\"/>\r\n        </onentry>\r\n        <onexit>\r\n            <log label=\"Request_final\" expr=\"\'exit Final state\'\"/>\r\n        </onexit>\r\n    </final>\r\n</businessclass>', , '[]');
INSERT INTO `ren_bo` VALUES ('BO_d7a6ab5d-f39b-4d35-ad55-e3980c408a02', 'GuestOrder', 'Process_112e4e9a-2e96-4d07-bdb9-365b55d3c354', '0', '<businessclass\r\n        initial=\"Initial\"\r\n        name=\"GuestOrder\"\r\n        version=\"1.0\"\r\n        xmlns=\"http://www.w3.org/2005/07/scxml\">\r\n    <datamodel>\r\n        <data expr=\"0\" id=\"startKOCount\"/>\r\n        <data expr=\"0\" id=\"finishKOCount\"/>\r\n    </datamodel>\r\n    <operations>\r\n        <task id=\"addItem\" brole=\"waiter\" name=\"addItemTask\">\r\n            <principle method=\"Offer\" distributor=\"QueueLength\">\r\n                <param name=\"length\" expr=\"lt 3\"/>\r\n            </principle>\r\n            <callback on=\"complete\" event=\"submit\"/>\r\n            <documentation>Test task documentation</documentation>\r\n        </task>\r\n        <task id=\"updateDeliTime\" brole=\"waiter\" name=\"updateDeliTimeTask\">\r\n            <principle method=\"Allocate\" distributor=\"ShortestQueue\"/>\r\n            <callback on=\"complete\" event=\"updateDeliTimeComplete\"/>\r\n        </task>\r\n    </operations>\r\n    <state id=\"Initial\">\r\n        <transition target=\"Dining\"/>\r\n    </state>\r\n    <state id=\"Dining\" initial=\"in\">\r\n        <onentry>\r\n            <call name=\"addItemTask\"/>\r\n        </onentry>\r\n        <state id=\"in\">\r\n            <transition target=\"Ordering\"/>\r\n        </state>\r\n        <state id=\"Ordering\">\r\n            <transition event=\"submit\" target=\"Active\">\r\n                <newbo src=\"KitchenOrder.xml\" instances=\"1\"/>\r\n                <assign location=\"startKOCount\" expr=\"startKOCount + 1\"/>\r\n            </transition>\r\n        </state>\r\n        <state id=\"Active\">\r\n            <transition event=\"addItem\" target=\"Ordering\"/>\r\n            <transition event=\"KitchenOrder.delivered\">\r\n                <call name=\"updateDeliTimeTask\"/>\r\n            </transition>\r\n            <transition event=\"KitchenOrder.finish\">\r\n                <assign location=\"finishKOCount\" expr=\"finishKOCount + 1\"/>\r\n            </transition>\r\n            <transition event=\"requestCheck\" cond=\"finishKOCount eq startKOCount\" target=\"Paying\">\r\n                <newbo src=\"GuestCheck.xml\" instances=\"1\"/>\r\n            </transition>\r\n        </state>\r\n        <final id=\"fin\"/>\r\n    </state>\r\n    <state id=\"Paying\">\r\n        <transition event=\"GuestCheck.finish\" target=\"GOFinal\"/>\r\n    </state>\r\n    <final id=\"GOFinal\"/>\r\n</businessclass>\r\n', , '[\"waiter\"]');
INSERT INTO `ren_bo` VALUES ('BO_e3d2fef7-aca2-4337-94be-ef6efa492dc8', 'GuestCheck', 'Process_112e4e9a-2e96-4d07-bdb9-365b55d3c354', '0', '<businessclass initial=\"Initial\" name=\"GuestCheck\" version=\"1.0\" xmlns=\"http://www.w3.org/2005/07/scxml\">\r\n    <datamodel>\r\n        <data expr=\"1\" id=\"Count\"/>\r\n    </datamodel>\r\n    <operations>\r\n        <task id=\"calculate\" brole=\"paymentCalculator\" name=\"calculateTask\">\r\n            <principle method=\"Allocate\" distributor=\"ShortestQueue\"/>\r\n            <callback on=\"complete\" event=\"calculated\"/>\r\n        </task>\r\n        <task id=\"Payment\" brole=\"paymentHandler\" name=\"paymentTask\">\r\n            <principle method=\"Allocate\" distributor=\"ShortestQueue\"/>\r\n            <callback on=\"complete\" event=\"paid\"/>\r\n        </task>\r\n        <task id=\"archive\" brole=\"archiveHandler\" name=\"archiveTask\">\r\n            <principle method=\"Allocate\" distributor=\"ShortestQueue\"/>\r\n            <callback on=\"complete\" event=\"archived\"/>\r\n        </task>\r\n    </operations>\r\n    <state id=\"Initial\">\r\n        <transition target=\"Preparing\"/>\r\n    </state>\r\n    <state id=\"Preparing\">\r\n        <onentry>\r\n            <call name=\"calculateTask\"/>\r\n        </onentry>\r\n        <transition event=\"calculated\" target=\"Paying\"/>\r\n    </state>\r\n    <state id=\"Paying\">\r\n        <onentry>\r\n            <call name=\"paymentTask\"/>\r\n        </onentry>\r\n        <transition event=\"paid\" target=\"Archiving\"/>\r\n    </state>\r\n    <state id=\"Archiving\">\r\n        <onentry>\r\n            <call name=\"archiveTask\"/>\r\n        </onentry>\r\n        <transition event=\"archived\" target=\"GCFinal\">\r\n            <send event=\"finish\" type=\"scxml\" messageMode=\"TO_PARENT\"/>\r\n        </transition>\r\n    </state>\r\n    <final id=\"GCFinal\"/>\r\n</businessclass>\r\n', , '[\"paymentHandler\",\"archiveHandler\",\"paymentCalculator\"]');
INSERT INTO `ren_bo` VALUES ('BO_e4a245e3-67d3-4007-8eb8-26ed5aadfe8e', 'KitchenOrder', 'Process_4d6570cf-e939-45cf-a609-4921abcfacf1', '0', '<businessclass name=\"KitchenOrder\" version=\"1.0\" xmlns=\"http://www.w3.org/2005/07/scxml\">\r\n    <tasks>\r\n        <task id=\"produceDishes\" brole=\"cook\" name=\"produceDishesTask\">\r\n            <principle method=\"Allocate\" distributor=\"ShortestQueue\"/>\r\n            <callback on=\"complete\" event=\"produced\"/>\r\n        </task>\r\n        <task id=\"testQuality\" brole=\"cook\" name=\"testQualityTask\">\r\n            <principle method=\"Allocate\" distributor=\"ShortestQueue\"/>\r\n            <callback on=\"complete\" event=\"testCompleted\"/>\r\n        </task>\r\n        <task id=\"deliver\" brole=\"waiter\" name=\"deliverTask\">\r\n            <principle method=\"Allocate\" distributor=\"ShortestQueue\"/>\r\n            <callback on=\"complete\" event=\"delivered\"/>\r\n        </task>\r\n        <task id=\"archive\" brole=\"archiveHandler\" name=\"archiveTask\">\r\n            <principle method=\"Allocate\" distributor=\"Random\"/>\r\n            <callback on=\"complete\" event=\"archived\"/>\r\n        </task>\r\n    </tasks>\r\n    <state id=\"Initial\">\r\n        <transition target=\"Producing\"/>\r\n    </state>\r\n    <state id=\"Producing\">\r\n        <onentry>\r\n            <call name=\"produceDishesTask\"/>\r\n        </onentry>\r\n        <transition event=\"produced\" target=\"QualityTesting\"/>\r\n    </state>\r\n    <state id=\"QualityTesting\">\r\n        <onentry>\r\n            <call name=\"testQualityTask\"/>\r\n        </onentry>\r\n        <transition event=\"testCompleted\" cond=\"_event.data.get(\'passed\') eq 0\" target=\"Producing\"/>\r\n        <transition event=\"testCompleted\" cond=\"_event.data.get(\'passed\') eq 1\" target=\"Delivering\"/>\r\n    </state>\r\n    <state id=\"Delivering\">\r\n        <onentry>\r\n            <call name=\"deliverTask\"/>\r\n        </onentry>\r\n        <transition event=\"delivered\" target=\"Archiving\">\r\n            <send event=\"delivered\" type=\"scxml\" messageMode=\"TO_PARENT\"/>\r\n        </transition>\r\n    </state>\r\n    <state id=\"Archiving\">\r\n        <onentry>\r\n            <call name=\"archiveTask\"/>\r\n        </onentry>\r\n        <transition event=\"archived\" target=\"KOFinal\">\r\n            <send event=\"finish\" type=\"scxml\" messageMode=\"TO_PARENT\"/>\r\n        </transition>\r\n    </state>\r\n    <final id=\"KOFinal\"/>\r\n</businessclass>\r\n', , '[]');
INSERT INTO `ren_bo` VALUES ('BO_e9cadc05-eb51-4d08-aebe-6742d8e63c3f', 'Crowdsourcing', 'Process_4bd51644-ce34-4d04-889c-d532b7f6a469', '0', '<businessclass\r\n        version=\"1.0\"\r\n        xmlns=\"http://www.w3.org/2005/07/scxml\"\r\n        name=\"Crowdsourcing\"\r\n        initial=\"Initial\">\r\n\r\n    <!--  -->\r\n    <datamodel>\r\n        <!---->\r\n        <data id=\"taskName\" expr=\"\"/>\r\n        <data id=\"taskDescription\" expr=\"\"/>\r\n        <data id=\"judgeCount\" expr=\"\"/>\r\n        <data id=\"decomposeCount\" expr=\"\"/>\r\n        <data id=\"decomposeVoteCount\" expr=\"\"/>\r\n        <data id=\"solveCount\" expr=\"\"/>\r\n        <data id=\"solveVoteCount\" expr=\"\"/>\r\n        <data id=\"supervisor\" expr=\"\'\'\"/>\r\n        <data id=\"ordinal\" expr=\"0\"/>\r\n        <data id=\"steps\" expr=\"0\"/>\r\n        <data id=\"count\" expr=\"0\"/>\r\n        <data id=\"complexCount\" expr=\"0\"/>\r\n        <data id=\"simpleCount\" expr=\"0\"/>\r\n        <data id=\"judgeCompleted\" expr=\"false\"/>\r\n    </datamodel>\r\n\r\n    <!--  -->\r\n    <tasks>\r\n        <task id=\"judge\" name=\"judgeTask\" brole=\"judger\">\r\n            <principle method=\"Allocate\" distributor=\"Round\"/>\r\n            <callback on=\"complete\" event=\"judgeComplete\"/>\r\n            <documentation>Judge task let judgers judge crowdsourcing task to be simple or complex.</documentation>\r\n            <param name=\"taskName\"/>\r\n            <param name=\"taskDescription\"/>\r\n        </task>\r\n        <task id=\"decompose\" name=\"decomposeTask\" brole=\"decomposer\">\r\n            <principle method=\"Allocate\" distributor=\"Round\"/>\r\n            <callback on=\"complete\" event=\"decomposeComplete\"/>\r\n            <documentation>Decompose task let decomposers decompose crowdsourcing task to be several sub tasks.</documentation>\r\n            <param name=\"taskName\"/>\r\n            <param name=\"taskDescription\"/>\r\n        </task>\r\n        <task id=\"decomposeVote\" name=\"decomposeVoteTask\" brole=\"decomposeVoter\">\r\n            <principle method=\"Allocate\" distributor=\"Round\"/>\r\n            <callback on=\"complete\" event=\"decomposeVoteComplete\"/>\r\n            <documentation>DecomposeVote task let decomposeVoters vote for decompose plans of a crowdsourcing task.</documentation>\r\n            <param name=\"taskName\"/>\r\n            <param name=\"taskDescription\"/>\r\n        </task>\r\n        <task id=\"getBestSchema\" name=\"getBestSchemaTask\" brole=\"decomposeQuerier\">\r\n            <principle method=\"Allocate\" distributor=\"Random\"/>\r\n            <callback on=\"complete\" event=\"queryComplete\"/>\r\n            <documentation>GetBestSchema task let a automicQuerier agent query for the best decompose schema in the database and return.</documentation>\r\n        </task>\r\n        <task id=\"solve\" name=\"solveTask\" brole=\"solver\">\r\n            <principle method=\"Allocate\" distributor=\"Round\"/>\r\n            <callback on=\"complete\" event=\"solveComplete\"/>\r\n            <documentation>Solve task let solvers solve a crowdsourcing task.</documentation>\r\n            <param name=\"taskName\"/>\r\n            <param name=\"taskDescription\"/>\r\n        </task>\r\n        <task id=\"solveVoting\" name=\"solveVoteTask\" brole=\"solveVoter\">\r\n            <principle method=\"Allocate\" distributor=\"Round\"/>\r\n            <callback on=\"complete\" event=\"solveVoteComplete\"/>\r\n            <documentation>SolveVote task let solveVoters vote for solutions of a crowdsourcing task.</documentation>\r\n            <param name=\"taskName\"/>\r\n            <param name=\"taskDescription\"/>\r\n        </task>\r\n        <task id=\"getBestSolution\" name=\"getBestSolutionTask\" brole=\"solutionQuerier\">\r\n            <principle method=\"Allocate\" distributor=\"Random\"/>\r\n            <callback on=\"complete\" event=\"choseComplete\"/>\r\n            <documentation>GetBestSchema task let a automicQuerier agent query for the best solution in the database and return.</documentation>\r\n            <param name=\"supervisor\"/>\r\n            <param name=\"ordinal\"/>\r\n        </task>\r\n        <task id=\"merge\" name=\"mergeTask\" brole=\"merger\">\r\n            <principle method=\"Allocate\" distributor=\"Random\"/>\r\n            <callback on=\"complete\" event=\"merged\"/>\r\n            <documentation>Merge task let a merger agent merge solutions of sub tasks to be a complete solution of a crowdsourcing task.</documentation>\r\n			<param name=\"supervisor\"/>\r\n            <param name=\"ordinal\"/>\r\n        </task>\r\n    </tasks>\r\n\r\n\r\n    <!--  -->\r\n\r\n    <!--  -->\r\n    <state id=\"Initial\">\r\n        <onentry>\r\n            <log label=\"CS_init\" expr=\"\'entry Initial state\'\"/>\r\n        </onentry>\r\n        <transition target=\"Judging\">\r\n            <call name=\"judgeTask\" instancesExpr=\"judgeCount\">\r\n                <param name=\"taskName\" expr=\"taskName\"/>\r\n                <param name=\"taskDescription\" expr=\"taskDescription\"/>\r\n            </call>\r\n        </transition>\r\n        <onexit>\r\n            <log label=\"CS_init\" expr=\"\'exit Initial state\'\"/>\r\n        </onexit>\r\n    </state>\r\n\r\n    <!-- Judging-->\r\n    <state id=\"Judging\">\r\n        <onentry>\r\n            <log label=\"CS_judging\" expr=\"\'entry Judging state\'\"/>\r\n        </onentry>\r\n\r\n        <transition event=\"judgeComplete\">\r\n            <if cond=\"_event.data.get(\'simple\') eq 1\">\r\n                <assign location=\"simpleCount\" expr=\"simpleCount + 1\"/>\r\n            <elseif cond=\"_event.data.get(\'simple\') eq 0\"/>\r\n                <assign location=\"complexCount\" expr=\"complexCount + 1\"/>\r\n            </if>\r\n            <if cond=\"simpleCount + complexCount eq judgeCount\">\r\n                <assign location=\"judgeCompleted\" expr=\"true\"/>\r\n            </if>\r\n        </transition>\r\n\r\n        <transition cond=\"judgeCompleted and simpleCount gt complexCount\" target=\"Solving\">\r\n            <call name=\"solveTask\" instancesExpr=\"solveCount\">\r\n                <param name=\"taskName\" expr=\"taskName\"/>\r\n                <param name=\"taskDescription\" expr=\"taskDescription\"/>\r\n            </call>\r\n        </transition>\r\n\r\n        <transition cond=\"judgeCompleted and simpleCount lt complexCount\" target=\"Decomposing\">\r\n            <call name=\"decomposeTask\" instancesExpr=\"decomposeCount\">\r\n                <param name=\"taskName\" expr=\"taskName\"/>\r\n                <param name=\"taskDescription\" expr=\"taskDescription\"/>\r\n            </call>\r\n        </transition>\r\n\r\n        <onexit>\r\n            <log label=\"CS_judging\" expr=\"\'exit Judging state\'\"/>\r\n            <assign location=\"simpleCount\" expr=\"0\"/>\r\n            <assign location=\"complexCount\" expr=\"0\"/>\r\n            <assign location=\"judgeCompleted\" expr=\"false\"/>\r\n        </onexit>\r\n    </state>\r\n\r\n\r\n    <!-- Decomposing-->\r\n    <state id=\"Decomposing\">\r\n        <onentry>\r\n            <log label=\"CS_decomposing\" expr=\"\'entry Decomposing state\'\"/>\r\n            <assign location=\"count\" expr=\"0\"/>\r\n        </onentry>\r\n\r\n        <transition event=\"decomposeComplete\">\r\n            <!-- decomposer -->\r\n            <assign location=\"count\" expr=\"count + 1\"/>\r\n        </transition>\r\n\r\n        <transition cond=\"count eq decomposeCount\" target=\"DecomposeVoting\">\r\n            <call name=\"decomposeVoteTask\" instancesExpr=\"decomposeVoteCount\">\r\n                <param name=\"taskName\" expr=\"taskName\"/>\r\n                <param name=\"taskDescription\" expr=\"taskDescription\"/>\r\n            </call>\r\n        </transition>\r\n\r\n        <onexit>\r\n            <log label=\"CS_decomposing\" expr=\"\'exit Decomposing state\'\"/>\r\n        </onexit>\r\n    </state>\r\n\r\n    <!-- DecomposeVotingdecomposer-->\r\n    <state id=\"DecomposeVoting\">\r\n        <onentry>\r\n            <log label=\"CS_decomposeVoting\" expr=\"\'entry DecomposeVoting state\'\"/>\r\n            <assign location=\"count\" expr=\"0\"/>\r\n        </onentry>\r\n\r\n        <transition event=\"decomposeVoteComplete\">\r\n            <assign location=\"count\" expr=\"count + 1\"/>\r\n        </transition>\r\n\r\n        <transition cond=\"count eq decomposeVoteCount\" target=\"HandlingBestDecompose\">\r\n            <call name=\"getBestSchemaTask\" instancesExpr=\"1\"/>\r\n        </transition>\r\n\r\n        <onexit>\r\n            <log label=\"CS_decomposing\" expr=\"\'exit DecomposeVoting state\'\"/>\r\n        </onexit>\r\n    </state>\r\n\r\n    <state id=\"HandlingBestDecompose\">\r\n		<onentry>\r\n            <log label=\"CS_HandlingBestDecompose\" expr=\"\'entry HandlingBestDecompose state\'\"/>\r\n            <assign location=\"steps\" expr=\"0\"/>\r\n        </onentry>\r\n        <transition event=\"queryComplete\" target=\"Waiting\">\r\n            <foreach array=\"_event.data\" item=\"kvpair\" index=\"currentIdx\">\r\n                <newbo src=\"Crowdsourcing.xml\" instancesExpr=\"1\">\r\n                    <param name=\"taskName\" expr=\"taskName\"/>\r\n                    <param name=\"taskDescription\" expr=\"kvpair.getValue()\"/>\r\n                    <param name=\"judgeCount\" expr=\"judgeCount\"/>\r\n                    <param name=\"decomposeCount\" expr=\"decomposeCount\"/>\r\n                    <param name=\"decomposeVoteCount\" expr=\"decomposeVoteCount\"/>\r\n                    <param name=\"solveCount\" expr=\"solveCount\"/>\r\n                    <param name=\"solveVoteCount\" expr=\"solveVoteCount\"/>\r\n                    <param name=\"supervisor\" expr=\"_gid\"/>\r\n                    <param name=\"ordinal\" expr=\"currentIdx\"/>\r\n                </newbo>\r\n                <assign location=\"steps\" expr=\"steps + 1\"/>\r\n            </foreach>\r\n        </transition>\r\n    </state>\r\n\r\n    <!-- Waiting -->\r\n    <state id=\"Waiting\">\r\n        <onentry>\r\n            <log label=\"CS_waiting\" expr=\"\'entry Waiting state \'\"/>\r\n            <assign location=\"count\" expr=\"0\"/>\r\n        </onentry>\r\n\r\n        <transition event=\"Crowdsourcing.finish\">\r\n            <assign location=\"count\" expr=\"count + 1\"/>\r\n        </transition>\r\n\r\n        <transition cond=\"count eq steps\" target=\"Merging\">\r\n            <call name=\"mergeTask\">\r\n				<param name=\"supervisor\" expr=\"supervisor\"/>\r\n                <param name=\"ordinal\" expr=\"ordinal\"/>\r\n			</call>\r\n        </transition>\r\n\r\n        <onexit>\r\n            <log label=\"CS_waiting\" expr=\"\'exit Waiting state \'\"/>\r\n        </onexit>\r\n    </state>\r\n\r\n    <!-- Merging -->\r\n    <state id=\"Merging\">\r\n        <onentry>\r\n            <log label=\"CS_merging\" expr=\"\'entry Merging state \'\"/>\r\n        </onentry>\r\n\r\n        <transition event=\"merged\" target=\"Final\">\r\n            <send event=\"finish\" type=\"scxml\" messageMode=\"TO_PARENT\"/>\r\n        </transition>\r\n\r\n        <onexit>\r\n            <log label=\"CS_merging\" expr=\"\'exit Merging state \'\"/>\r\n        </onexit>\r\n    </state>\r\n\r\n    <!-- Solving-->\r\n    <state id=\"Solving\">\r\n        <onentry>\r\n            <log label=\"CS_solving\" expr=\"\'entry Solving state \'\"/>\r\n            <assign location=\"count\" expr=\"0\"/>\r\n        </onentry>\r\n\r\n        <transition event=\"solveComplete\">\r\n            <assign location=\"count\" expr=\"count + 1\"/>\r\n        </transition>\r\n\r\n        <transition cond=\"count eq solveCount\" target=\"SolveVoting\">\r\n            <call name=\"solveVoteTask\" instancesExpr=\"solveVoteCount\">\r\n                <param name=\"taskName\" expr=\"taskName\"/>\r\n                <param name=\"taskDescription\" expr=\"taskDescription\"/>\r\n            </call>\r\n        </transition>\r\n\r\n        <onexit>\r\n            <log label=\"CS_solving\" expr=\"\'exit Solving state \'\"/>\r\n        </onexit>\r\n    </state>\r\n\r\n    <!-- SolveVoting state  -->\r\n    <state id=\"SolveVoting\">\r\n        <onentry>\r\n            <log label=\"CS_solveVoting\" expr=\"\' entry SolveVoting state \'\"/>\r\n            <assign location=\"count\" expr=\"0\"/>\r\n        </onentry>\r\n\r\n        <transition event=\"solveVoteComplete\">\r\n            <assign location=\"count\" expr=\"count + 1\"/>\r\n        </transition>\r\n\r\n        <transition cond=\"count eq solveVoteCount\" target=\"HandlingBestSolution\">\r\n            <call name=\"getBestSolutionTask\" instancesExpr=\"1\">\r\n                <param name=\"supervisor\" expr=\"supervisor\"/>\r\n                <param name=\"ordinal\" expr=\"ordinal\"/>\r\n            </call>\r\n        </transition>\r\n\r\n        <onexit>\r\n            <log label=\"CS_solveVoting\" expr=\"\' exit SolveVoting state \'\"/>\r\n        </onexit>\r\n    </state>\r\n\r\n    <!-- Handle best solution state  -->\r\n    <state id=\"HandlingBestSolution\">\r\n        <transition event=\"choseComplete\" target=\"Final\">\r\n            <send event=\"finish\" type=\"scxml\" messageMode=\"TO_PARENT\"/>\r\n        </transition>\r\n    </state>\r\n\r\n    <!-- Final state  -->\r\n    <final id=\"Final\">\r\n        <onentry>\r\n            <log label=\"CS_final\" expr=\"\' entry Final state \'\"/>\r\n        </onentry>\r\n        <onexit>\r\n            <log label=\"CS_final\" expr=\"\' exit Final state \'\"/>\r\n        </onexit>\r\n    </final>\r\n</businessclass>', , '[\"decomposer\",\"decomposeQuerier\",\"decomposeVoter\",\"solveVoter\",\"solutionQuerier\",\"judger\",\"merger\",\"solver\"]');
INSERT INTO `ren_bo` VALUES ('BO_ed867fd2-efb4-4be3-acba-0149f9cdf8dc', 'GuestCheck', 'Process_4d6570cf-e939-45cf-a609-4921abcfacf1', '0', '<businessclass initial=\"Initial\" name=\"GuestCheck\" version=\"1.0\" xmlns=\"http://www.w3.org/2005/07/scxml\">\r\n    <datamodel>\r\n        <data expr=\"1\" id=\"Count\"/>\r\n    </datamodel>\r\n    <tasks>\r\n        <task id=\"calculate\" brole=\"paymentCalculator\" name=\"calculateTask\">\r\n            <principle method=\"Allocate\" distributor=\"ShortestQueue\"/>\r\n            <callback on=\"complete\" event=\"calculated\"/>\r\n        </task>\r\n        <task id=\"Payment\" brole=\"paymentHandler\" name=\"paymentTask\">\r\n            <principle method=\"Allocate\" distributor=\"ShortestQueue\"/>\r\n            <callback on=\"complete\" event=\"paid\"/>\r\n        </task>\r\n        <task id=\"archive\" brole=\"archiveHandler\" name=\"archiveTask\">\r\n            <principle method=\"Allocate\" distributor=\"ShortestQueue\"/>\r\n            <callback on=\"complete\" event=\"archived\"/>\r\n        </task>\r\n    </tasks>\r\n    <state id=\"Initial\">\r\n        <transition target=\"Preparing\"/>\r\n    </state>\r\n    <state id=\"Preparing\">\r\n        <onentry>\r\n            <call name=\"calculateTask\"/>\r\n        </onentry>\r\n        <transition event=\"calculated\" target=\"Paying\"/>\r\n    </state>\r\n    <state id=\"Paying\">\r\n        <onentry>\r\n            <call name=\"paymentTask\"/>\r\n        </onentry>\r\n        <transition event=\"paid\" target=\"Archiving\"/>\r\n    </state>\r\n    <state id=\"Archiving\">\r\n        <onentry>\r\n            <call name=\"archiveTask\"/>\r\n        </onentry>\r\n        <transition event=\"archived\" target=\"GCFinal\">\r\n            <send event=\"finish\" type=\"scxml\" messageMode=\"TO_PARENT\"/>\r\n        </transition>\r\n    </state>\r\n    <final id=\"GCFinal\"/>\r\n</businessclass>\r\n', , '[]');
